import ReactDom from "react-dom";

function LoginBtn(props) {
  return ReactDom.createPortal(
    <button
      className="main-header-buttons"
      id="login-button"
      onClick={props.openedTunnel1}
    >
      <strong>LOGIN</strong>
    </button>
  ),     document.getElementById("modal1")
  ;
}

export default LoginBtn;
